Song.create!([
  {album_id: nil, singer_id: nil, team_id: nil, title: "어디에도", genre1: "가요", genre2: "발라드", runtime: "05:31", lyrics: "\n\t\t\t\t\t\t\t<div>어디에도 - 05:31</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">차가워진 눈빛을 바라보며 \r\n이별의 말을 전해 들어요\r\n아무 의미 없던 노래 가사가 \r\n아프게 귓가에 맴돌아요\r\n\r\n다시 겨울이 시작되듯이 \r\n흩어지는 눈 사이로\r\n그대 내 맘에 쌓여만 가네\r\n\r\n떠나지 말라는 \r\n그런 말도 하지 못하고\r\n고개를 떨구던 뒷모습만\r\n\r\n그대 내게 오지 말아요 \r\n두 번 다시 이런 사랑하지 마요\r\n그댈 추억하기보단 \r\n기다리는 게 부서진 \r\n내 맘이 더 아파 와\r\n다시 누군가를 만나서 \r\n결국 우리 사랑 지워내도\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어주기를\r\n\r\n아무것도 마음대로 안 돼요 \r\n아픔은 그저 나를 따라와\r\n밤새도록 커져 버린 그리움 \r\n언제쯤 익숙해져 가나요\r\n\r\n많은 날들이 떠오르네요 \r\n우리가 나눴던 날들\r\n애써 감추고 돌아서네요\r\n\r\n떠나지 말라는 \r\n그런 말도 하지 못하고\r\n고개를 떨구던 뒷모습만\r\n\r\n그대 내게 오지 말아요 \r\n두 번 다시 이런 사랑하지 마요\r\n그댈 추억하기보단 \r\n기다리는 게 부서진 \r\n내 맘이 더 아파 와\r\n다시 누군가를 만나서 \r\n결국 우리 사랑 지워내도\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어주기를\r\n\r\n부를 수도 없이 멀어진 그대가\r\n\r\n지나치는 바람에도 \r\n목이 메어와 어디에도 \r\n그대가 살아서\r\n우린 사랑하면 안 돼요\r\n다가갈수록 미워지니까\r\n행복했던 것만 기억에 남아 \r\n나를 천천히 잊어가기를\r\n사랑했던</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/784/293/80784293_1453884534908_1_600x600.JPG", song_tjnum: 46009, song_num: 85887585, lowkey: "D4#", highkey: "D6"},
    {album_id: nil, singer_id: nil, team_id: nil, title: "봄인가 봐 (Spring Love)", genre1: "가요", genre2: "발라드", runtime: "03:19", lyrics: "\n\t\t\t\t\t\t\t<div>봄인가 봐 (Spring Love) - 03:19</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">눈꽃이 내린 버스 정류장에 \r\n날 데려다주다\r\n꼭 내 손을 잡는 너 때문에 \r\n나 놀랐어\r\n아주 오래전부터 숨겼던 \r\n내 맘이 들킨 걸까\r\n부는 바람에 실린 \r\n우리에게 번진 This is love \r\n\r\n내 마음에 내려와 \r\n사뿐히 내려와\r\n네 어깨 위에도 \r\n벌써 내린 그 이름 \r\n봄인가 봐\r\n우리 잡은 손 틈 사이 \r\n얇아진 외투 사이\r\n어느새 스며들어 \r\n우릴 변화시킨 \r\n봄이 왔나 봐\r\n\r\n첨엔 그랬어 편한 친구 \r\n혹 동생 같았어\r\n치마를 입고 꾸민 모습에도 \r\n놀라지 않았어\r\n뭐가 우릴 지금 이렇게 \r\n바꿔 놓은 걸까\r\nMaybe it’s crazy \r\nCan I call you my baby Yeah\r\n\r\n내 마음에 내려와 \r\n사뿐히 내려와\r\n네 어깨 위에도 \r\n벌써 내린 그 이름 \r\n봄인가 봐\r\n우리 잡은 손 틈 사이 \r\n얇아진 외투 사이\r\n어느새 스며들어 \r\n우릴 변화시켜 Oh\r\n\r\n우리 서로에 \r\n기대어 잠든 벤치\r\n투명한 하늘에 물든 \r\nSweet cherry blossom\r\n늘 이러면 좋겠다 Yeah\r\n우릴 바꾼 그 이름 \r\n봄봄봄 봄 Ooh\r\n널 사랑해 너를 사랑해 \r\n사랑해 널 Yeah\r\n\r\n넌 봄이 돼줘 \r\n항상 나는 꽃이 될게 \r\n서로를 녹여주고 \r\n열리게 해주면 좋겠다\r\n안 보이던 마음과 마음 \r\n마주한 시선 사이 \r\n겨우내 숨어있던 \r\n꽃이 피었나 봐 \r\n봄이 왔나 봐</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/797/320/80797320_1456999961311_1_600x600.JPG", song_tjnum: 46142, song_num: 86027188, lowkey: "F3#", highkey: "G4#"},
      {album_id: nil, singer_id: nil, team_id: nil, title: "걱정말아요 그대", genre1: "OST", genre2: "드라마", runtime: "03:52", lyrics: "\n\t\t\t\t\t\t\t<div>걱정말아요 그대 - 03:52</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 아무 걱정 하지 말아요\r\n우리 함께 노래 합시다\r\n그대 아픈 기억들 모두 그대여\r\n그대 가슴에 깊이 묻어 버리고 \r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n떠난 이에게 노래 하세요\r\n후회없이 사랑했노라 말해요\r\n\r\n그대는 너무 힘든 일이 많았죠\r\n새로움을 잃어 버렸죠\r\n그대 슬픈 얘기들 모두 그대여\r\n그대 탓으로 훌훌 털어 버리고\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n\r\n지나간 것은 지나간 대로\r\n그런 의미가 있죠\r\n우리 다 함께 노래 합시다\r\n후회없이 꿈을 꾸었다 말해요\r\n새로운 꿈을 꾸겠다 말해요</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/736/024/80736024_1446818236525_1_600x600.JPG", song_tjnum: 45592, song_num: 85398843, lowkey: "A2", highkey: "A4"},
        {album_id: nil, singer_id: nil, team_id: nil, title: "벚꽃 엔딩", genre1: "가요", genre2: "락", runtime: "04:20", lyrics: "\n\t\t\t\t\t\t\t<div>벚꽃 엔딩 - 04:20</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대여 그대여 그대여 그대여 그대여\r\n\r\n오늘은 우리 같이 걸어요 이 거리를\r\n밤에 들려오는 자장노래 어떤가요 오예\r\n\r\n몰랐던 그대와 단 둘이 손 잡고\r\n알 수 없는 이 떨림과 둘이 걸어요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요 오예\r\n\r\n그대여 우리 이제 손 잡아요 이 거리에\r\n마침 들려오는 사랑 노래 어떤가요 오예\r\n\r\n사랑하는 그대와 단 둘이 손잡고\r\n알 수 없는 이 거리를 둘이 걸어요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요 \r\n\r\n바람 불면 울렁이는 기분 탓에 나도 모르게 \r\n바람 불면 저편에서 \r\n그대여 니 모습이 자꾸 겹쳐\r\n오 또 울렁이는 기분 탓에 나도 모르게\r\n바람 불면 저편에서 \r\n그대여 니 모습이 자꾸 겹쳐\r\n\r\n사랑하는 연인들이 많군요 \r\n알 수 없는 친구들이 많아요\r\n흩날리는 벚꽃 잎이 많군요 좋아요\r\n\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이 \r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n봄바람 휘날리며 흩날리는 벚꽃 잎이\r\n울려 퍼질 이 거리를 우우 둘이 걸어요\r\n\r\n그대여 그대여 그대여 그대여 그대여</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/287/115/80287115_1332318513743_1_600x600.JPG", song_tjnum: 35184, song_num: 81302362, lowkey: "C4#", highkey: "A5"},
          {album_id: nil, singer_id: nil, team_id: nil, title: "응급실", genre1: "OST", genre2: "드라마", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>응급실 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">후회 하고 있어요 \r\n우리 다투던 그 날 \r\n괜한 자존심 때문에 \r\n끝내자고 말을 해버린거야 \r\n금방 볼 줄 알았어 \r\n날 찾길 바래왔어 \r\n허나 며칠이 지나도 \r\n아무 소식조차 없어 \r\n항상 내게 너무 잘해줘서\r\n쉽게 생각했나봐 \r\n이젠 알아 내 고집때문에 \r\n힘들었던 너를 \r\n이 바보야 진짜 아니야 \r\n아직도 나를 그렇게 몰라 \r\n너를 가진 사랑 나밖엔 없는데 \r\n제발 나를 떠나가지마 \r\n언제라도 내 편이 돼준 너 \r\n고마운 줄 모르고 \r\n철없이 나 멋대로한거 \r\n용서할수 없니 \r\n이 바보야 진짜 아니야 \r\n아직도 나를 그렇게 몰라 \r\n너를 가진 사랑 나 밖엔 없는데 \r\n제발 떠나가지마 \r\n너 하나만 사랑하는데 \r\n이대로 나를 두고 가지마 \r\n나를 버리지마 그냥 날 안아줘 \r\n다시 사랑하게 돌아와</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/029/371/15029371_1342400749964_1_600x600.JPG", song_tjnum: 14515, song_num: 16186028, lowkey: "G3", highkey: "G5#"},
            {album_id: nil, singer_id: nil, team_id: nil, title: "친구라도 될 걸 그랬어", genre1: "가요", genre2: "R&amp;B/소울", runtime: "04:41", lyrics: "\n\t\t\t\t\t\t\t<div>친구라도 될 걸 그랬어 - 04:41</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">벌써 넌 내가 편하니\r\n웃으며 인사할 만큼\r\n까맣게 나를 잊었니\r\n니 곁에 있는 사람 소개할 만큼\r\n견디긴 너무 힘든데\r\n자꾸만 울고 싶은데\r\n내 옆이 아닌 자리에\r\n너를 보고 있는 게\r\n왜 그게 행복한걸까\r\n\r\n친구라도 될 걸 그랬어\r\n모두 다 잊고서\r\n다른 사람 만나는\r\n널 보아도 슬프지 않게\r\n그저 바라보고 있었어\r\n한참 동안 니 옆에\r\n그 사람까지도\r\n잠시라도 더 보려고\r\n다시 혹시라도 널 보게 되면\r\n그 땐 모르는 척 해볼게\r\n웃어도 볼게\r\n지금의 너처럼 우-\r\n\r\n눈감지 말고 보낼 걸\r\n가는 널 꼭 지켜볼걸\r\n차가운 너의 걸음에\r\n마지막 내 눈물도\r\n묻혀서 보내버릴걸\r\n\r\n너무 모진 너의 모습이\r\n미워져 버려서\r\n다른 사람 만나는\r\n널 보아도 슬프지 않게\r\n그저 바라보고 있었어\r\n한참 동안 니 옆에\r\n그 사람까지도\r\n잠시라도 더 보려고\r\n다시 혹시라도 널 보게 되면\r\n그땐 모르는 척 해볼게\r\n웃어도 볼게 지금의 너처럼\r\n\r\n차라리 잘된 것 같아\r\n다시 널 또 한번\r\n미워할 수 있을 테니\r\n\r\n혹시 아직 너도 나처럼\r\n편해지지 못하고\r\n아파만 하는 거니\r\n애써 너도 참는 거니\r\n혹시 니가 다시 돌아올까 봐\r\n나의 곁엔 아직 그대로\r\n비워져 있어 너의 자리라서</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/641/15027641_1383204820697_1_600x600.JPG", song_tjnum: 11238, song_num: 16158949, lowkey: "D4", highkey: "D6"},
              {album_id: nil, singer_id: nil, team_id: nil, title: "또 다시 사랑", genre1: "가요", genre2: "발라드", runtime: "04:36", lyrics: "\n\t\t\t\t\t\t\t<div>또 다시 사랑 - 04:36</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아픔이 좀 더 작아질까\r\n의미 없는 만남을 하다가\r\n어느 날 그대가 흘린 눈물\r\n왠지 나와 같다 느껴서\r\n\r\n이렇게 그대를\r\n지키는가 봐요\r\n행복하고 싶었던 그대를\r\n몰랐던 누군갈\r\n또 알아가면서\r\n분명 행복할 걸 알겠지만\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n\r\n어느 날 그대가 숨긴 눈물\r\n왠지 나와 같다 느껴서\r\n이렇게 그대를\r\n지키는 가 봐요\r\n행복하고 싶었던 그대를\r\n몰랐던 누군갈\r\n또 알아가는 게\r\n혹시 두렵기도 하겠지만\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n\r\n절대 우리 작은\r\n다툼조차 하지 마요\r\n이별 후엔 서운함만\r\n가슴속에 남으니\r\n사소한 그 표현이 그 말들이\r\n언제나 나에겐\r\n참 고마울 거예요\r\n\r\n내가 그대를 만났다는 건\r\n어쩌면 흘러가는\r\n흔한 인연이란\r\n것일지 모르지만\r\n\r\n오늘도 다시\r\n또 다시 사랑해요\r\n사랑 언제나\r\n이번이 마지막이라며\r\n처음인 듯 찾아오니까\r\n사랑 언제나\r\n이번이 마지막이라며</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/684/047/80684047_1442847061816_1_600x600.JPG", song_tjnum: 45372, song_num: 85059847, lowkey: "C4", highkey: "A5#"},
                {album_id: nil, singer_id: nil, team_id: nil, title: "소주 한잔", genre1: "가요", genre2: "발라드", runtime: "04:51", lyrics: "\n\t\t\t\t\t\t\t<div>소주 한잔 - 04:51</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">술이 한 잔 생각 나는 밤 \r\n같이 있는 것 같아요\r\n그 좋았던 시절들 \r\n이젠 모두 한숨만 되네요\r\n\r\n떠나는 그대 얼굴이 \r\n혹시 울지나 않을까\r\n난 먼저 돌아섰죠 \r\n그때부터 그리워요\r\n\r\n사람이 변하는 걸요 \r\n다시 전보다 그댈 원해요\r\n이렇게 취할때면 \r\n꺼져버린 전화를 붙잡고\r\n\r\n여보세요 나야 거기 잘 지내니 \r\n여보세요 왜 말 안하니\r\n울고 있니 내가 오랜만이라서\r\n사랑하는 사람이라서\r\n\r\n그대 소중한 마음 밀쳐낸 \r\n이기적인 그때의 나에게\r\n그대를 다시 불러오라고 \r\n미친듯이 외쳤어\r\n\r\n떠나는 그대 얼굴이 \r\n마치 처음과 같아서\r\n나 눈물이 났어요 \r\n그때부터 그리워요\r\n\r\n사람이 변하는 걸요 \r\n다시 전보다 그댈 원해요\r\n이렇게 취할때면 \r\n바뀌어버린 전화번호를 누르고\r\n\r\n여보세요 나야 거기 잘 지내니 \r\n오랜만이야 내 사랑아\r\n그대를 다시 불러오라고 \r\n미친듯이 울었어\r\n\r\n여보세요 나야 정말 미안해 \r\n이기적인 그때의 나에게\r\n그대를 다시 불러 오라고 \r\n미친듯이 외쳤어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/208/15027208_1378461687374_1_600x600.JPG", song_tjnum: 11491, song_num: 16149465, lowkey: "F3#", highkey: "B5"},
                  {album_id: nil, singer_id: nil, team_id: nil, title: "이 사랑", genre1: "OST", genre2: "드라마", runtime: "03:45", lyrics: "\n\t\t\t\t\t\t\t<div>이 사랑 - 03:45</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">시간을 되돌리면 \r\n기억도 지워질까\r\n해볼 수도 없는 말들을 \r\n내뱉는 걸 알아\r\n\r\n널 힘들게 했고 \r\n눈물로 살게 했던\r\n미안한 마음에 그런 거야\r\n\r\n하지만 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요. 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n\r\n사랑은 그런가봐 \r\n무슨 말을 해봐도\r\n채워지지 않은 것 같은 \r\n마음이 드나봐\r\n\r\n내 욕심이라고 \r\n다시 생각을 해봐도\r\n그 마음 쉽게 사라지지 않아\r\n\r\n알잖아 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n\r\n돌아가도 다시 견딜 수 있을까\r\n너무 힘들던 시간들\r\n\r\n흔들리지 않은 너를 볼 때면\r\n떨리는 내 입술이\r\n\r\n두루루..두루루..\r\n\r\n알잖아 난 말야\r\n너의 밖에선 살 수 없어\r\n\r\n내겐 너 하나로 물든 시간만이 \r\n흘러갈 뿐이야\r\n\r\n사랑해요 고마워요 \r\n따뜻하게 나를 안아줘\r\n이 사랑 땜에 나는 살 수 있어\r\n사랑 땜에 나는 살 수 있어</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/811/383/80811383_1461060922822_1_600x600.JPG", song_tjnum: 46136, song_num: 86163654, lowkey: "F3#", highkey: "E5"},
                    {album_id: nil, singer_id: nil, team_id: nil, title: "시간을 달려서 (Rough)", genre1: "가요", genre2: "댄스", runtime: "03:29", lyrics: "\n\t\t\t\t\t\t\t<div>시간을 달려서 (Rough) - 03:29</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">다가서지 못하고 \r\n헤매이고 있어\r\n좋아하지만 \r\n다른 곳을 보고 있어\r\n가까워 지려고 \r\n하면 할수록\r\n멀어져 가는 \r\n우리 둘의 마음처럼\r\n\r\n만나지 못해 맴돌고 있어\r\n우린 마치 평행선처럼\r\n말도 안돼 우린 \r\n반드시 만날 거야\r\n기다릴게 언제까지나\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n손을 잡아줄게\r\n\r\n다가서려 해봐도 \r\n엇갈리고 있어\r\n좋아한단 말도 \r\n아직 못하고 있어\r\n머뭇거리는 \r\n널 보고 있으면\r\n우린 아직도 많이 \r\n어리긴 한가 봐\r\n\r\n좁혀지지 않아 한 끗 차이\r\n우린 마치 평행선처럼\r\n언젠가는 못다한 \r\n말을 전할 거야\r\n다가갈게 언제까지나\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n손을 잡아줄게\r\n\r\n시간 속에 갇혀 \r\n길을 헤매여도\r\n그렇지만 우린 \r\n결국 만날 거야\r\n진심인 것만 \r\n알아줘 정말\r\n서툴기만 한대도\r\n\r\n미처 말하지 못했어 \r\n다만 너를 좋아했어\r\n어린 날의 꿈처럼 \r\n마치 기적처럼\r\n시간을 달려서 \r\n어른이 될 수만 있다면\r\n거친 세상 속에서 \r\n너를 안아줄게\r\n\r\n이거 하나만 약속해 \r\n변치 않기를 바랄게\r\n그때도 지금처럼 \r\n날 향해 웃어줘\r\n시간이 흘러서\r\n어른이 될 수만 있다면\r\n엇갈림 그 속에서 \r\n손을 잡아줄게</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/782/846/80782846_1453641841573_1_600x600.JPG", song_tjnum: 45993, song_num: 85871514, lowkey: "C4", highkey: "D5#"},
                      {album_id: nil, singer_id: nil, team_id: nil, title: "You Are My Everything", genre1: "OST", genre2: "드라마", runtime: "04:01", lyrics: "\n\t\t\t\t\t\t\t<div>You Are My Everything - 04:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">처음부터 그대였죠.\r\n나에게 다가올 한 사람.\r\n단 한 번의 스침에도 \r\n내 눈빛이 말을 하죠.\r\n\r\n바람처럼 스쳐가는\r\n인연이 아니길 바래요.\r\n바보처럼 먼저 말하지 못했죠.\r\n할 수가 없었죠.\r\n\r\nYou are my everything\r\n별처럼 쏟아지는 운명에\r\n그대라는 사람을 만나고\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything\r\n\r\n안갯속에 피어나는\r\n하얗게 물들은 그대 모습\r\n한순간에 내게 심장이 \r\n멈출 듯 다가와 버렸죠.\r\n\r\nYou are my everything\r\n별처럼 쏟아지는 운명에\r\n그대라는 사람을 만나고\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything\r\n\r\n시작도 못 했던 나의 사랑을 \r\n이제는 말할 수 있죠\r\n누구도 가질 수 없는 기적인데\r\n\r\nYou are my everything\r\n뜨거운 내 사랑은 그댄 걸\r\n계절이 변해도 난 이곳에\r\n멈춰버린 내 가슴속에\r\n단 하나의 사랑\r\nYou are my everything</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/811/383/80811383_1461060922822_1_600x600.JPG", song_tjnum: 46169, song_num: 86163655, lowkey: "A3#", highkey: "D5#"},
                        {album_id: nil, singer_id: nil, team_id: nil, title: "야생화", genre1: "가요", genre2: "발라드", runtime: "05:12", lyrics: "\n\t\t\t\t\t\t\t<div>야생화 - 05:12</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">하얗게 피어난 얼음 꽃 하나가\r\n달가운 바람에 얼굴을 내밀어\r\n아무 말 못했던 이름도 몰랐던\r\n지나간 날들에 눈물이 흘러\r\n\r\n차가운 바람에 숨어 있다\r\n한줄기 햇살에 몸 녹이다\r\n그렇게 너는 또 한번 내게 온다\r\n\r\n좋았던 기억만\r\n그리운 마음만\r\n니가 떠나간 그 길 위에\r\n이렇게 남아 서있다\r\n잊혀질 만큼만\r\n괜찮을 만큼만\r\n눈물 머금고 기다린 떨림 끝에 \r\n다시 나를 피우리라\r\n\r\n사랑은 피고 또 지는\r\n타버리는 불꽃\r\n빗물에 젖을까 두 눈을 감는다\r\n\r\n어리고 작았던 나의 맘에\r\n눈부시게 빛나던 추억 속에\r\n그렇게 너를 또 한번 불러본다\r\n\r\n좋았던 기억만\r\n그리운 마음만\r\n니가 떠나간 그 길 위에\r\n이렇게 남아 서있다\r\n잊혀질 만큼만\r\n괜찮을 만큼만\r\n눈물 머금고 기다린 떨림 끝에 \r\n다시 나는 \r\n\r\n메말라가는 땅 위에 \r\n온몸이 타 들어가고\r\n내 손끝에 남은\r\n너의 향기 흩어져 날아가\r\n\r\n멀어져 가는 너의 손을\r\n붙잡지 못해 아프다\r\n살아갈 만큼만\r\n미워했던 만큼만\r\n먼 훗날 너를 데려다 줄 \r\n그 봄이 오면 그날에 나 피우리라</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/414/439/80414439_1395973335427_1_600x600.JPG", song_tjnum: 38263, song_num: 82402846, lowkey: "D3#", highkey: "C5"},
                          {album_id: nil, singer_id: nil, team_id: nil, title: "체념", genre1: "가요", genre2: "발라드", runtime: "05:00", lyrics: "\n\t\t\t\t\t\t\t<div>체념 - 05:00</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">행복했어 너와의 시간들 \r\n아마도 너는 힘들었겠지 \r\n너의 마음을 몰랐던 건 아니야 \r\n나도 느꼈었지만 \r\n\r\n널 보내는 게 널 떠나 보내는 게 \r\n아직은 익숙하지가 않아 \r\n그렇게 밖에 할 수 없던 니가 원망스러워 \r\n\r\n왜 말 안 했니 아님 못한거니 \r\n조금도 날 생각하지 않았니 \r\n좋아한다며 사랑한다며 \r\n이렇게 끝낼 거면서 왜 그런 말을 했니 \r\n\r\n널 미워해야만 하는 거니 \r\n아니면 내 탓을 해야만 하는 거니 \r\n시간을 돌릴 수만 있다면 다시 예전으로 \r\n돌아가고 싶은 마음 뿐이야 \r\n\r\n왜 말 안 했니 아님 못한 거니 \r\n조금도 날 생각하지 않았니 \r\n좋아한다며 사랑한다며 \r\n이렇게 끝낼 거면서 왜 그런 말을 했니 \r\n\r\n널 미워해야만 하는 거니 \r\n아니면 내 탓을 해야만 하는 거니 \r\n시간을 돌릴 수만 있다면 다시 예전으로 \r\n돌아가고 싶은 마음 뿐이야 \r\n\r\n그래 더 이상 묻지 않을게 \r\n내 곁을 떠나고 싶다면 \r\n돌아보지 말고 떠나가 \r\n\r\n눈물은 흘리지 않을 게\r\n괜히 마음만 약해지니까 \r\n\r\n내게서 멀어진 니 모습이\r\n흐릿하게 보여 눈물이 나나봐 \r\n\r\n널 많이 그리워 할 것 같아 \r\n참아야만 하겠지 잊혀 질 수있도록 \r\n\r\n다시 사랑 같은 거 하지 않을래 \r\n\r\n내 마지막 사랑은 \r\n돌아선 너에게 주고 싶어서 \r\n\r\n행복하길 바래 \r\n나보다 좋은 여자 만나기를</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/027/640/15027640_1399965645543_1_600x600.JPG", song_tjnum: 11019, song_num: 16158939, lowkey: "F3", highkey: "F5"},
                            {album_id: nil, singer_id: nil, team_id: nil, title: "ALWAYS", genre1: "OST", genre2: "드라마", runtime: "03:25", lyrics: "\n\t\t\t\t\t\t\t<div>ALWAYS - 03:25</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대를 바라볼 때면 \r\n모든 게 멈추죠\r\n언제부턴지 나도 모르게였죠\r\n\r\n어느 날 꿈처럼 그대 다가와 \r\n내 맘을 흔들죠\r\n운명이란 걸 나는 느꼈죠\r\n\r\nI love you \r\n듣고 있나요 \r\nOnly you\r\n눈을 감아 봐요. \r\n\r\n바람에 흔들려 온 그대 사랑\r\nWhenever, wherever you are\r\nWhenever, wherever you are\r\nOh oh\r\nOh love, love, love\r\n\r\n어쩌다 내가 널 사랑했을까 \r\n밀어내려 해도 \r\n내 가슴이 널 알아봤을까\r\n\r\nI love you \r\n듣고 있나요 \r\nOnly you\r\n눈을 감아 봐요. \r\n모든 게 변해도 변하지 않아\r\n넌 나의, 난 너의 사랑\r\n\r\n그대 조금 돌아온대도\r\n다시 나를 스쳐 지나더라도\r\n괜찮아요 그댈 위해 \r\n내가 여기 있을게\r\n\r\nI love you \r\n잊지 말아요. \r\nOnly you\r\n내 눈물의 고백\r\n바람에 흩날려 온 그대 사랑\r\n\r\nWhenever, wherever you are\r\nWhenever, wherever you are</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/811/383/80811383_1461060922822_1_600x600.JPG", song_tjnum: 46088, song_num: 86163652, lowkey: "A3", highkey: "D5"},
                              {album_id: nil, singer_id: nil, team_id: nil, title: "가시", genre1: "가요", genre2: "락", runtime: "04:02", lyrics: "\n\t\t\t\t\t\t\t<div>가시 - 04:02</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">너 없는 지금도\r\n눈부신 하늘과 \r\n눈부시게 웃는 사람들 \r\n나의 헤어짐은\r\n모르는 세상은 \r\n슬프도록 그대로인데 \r\n\r\n시간마저 데려가지 못하게 \r\n나만은 널 보내지 못했나봐 \r\n가시처럼 깊게 박힌 기억은 \r\n아파도 아픈줄 모르고 \r\n\r\n그대 기억이 지난 사랑이 \r\n내 안을 파고 드는\r\n가시가 되어 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데 \r\n\r\n아픈만큼 너를 잊게 된다면 \r\n차라리 앓고 나면 그만인데 \r\n가시처럼 깊게 박힌 기억은 \r\n아파도 아픈줄 모르고 \r\n그대 기억이 지난 사랑이 \r\n내 안을 파고 드는\r\n가시가 되어 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데 \r\n\r\n너무 사랑했던 나를 \r\n그게 두려웠던 나를 \r\n미치도록 너를 그리워했던 \r\n날 이제는 놓아줘 \r\n\r\n보이지 않아 내 안에 숨어 \r\n잊으려 하면 할수록\r\n더 아파와 \r\n제발 가라고 아주 가라고 \r\n애써도 나를 괴롭히는데</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/017/465/580/17465580_1445915794128_1_600x600.JPG", song_tjnum: 14684, song_num: 17465599, lowkey: "F4#", highkey: "A5"},
                                {album_id: nil, singer_id: nil, team_id: nil, title: "Don't Cry", genre1: "가요", genre2: "락", runtime: "05:01", lyrics: "\n\t\t\t\t\t\t\t<div>Don't Cry - 05:01</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">그대의 눈물이 마를 때까지\r\n우리의 사랑을 볼 수 없을테니\r\n울지말아요 이제야 나는 알겠으니\r\n날 사랑하던 그대는 이미 없다는 걸\r\n\r\nSo you don’t cry for me\r\n세월 지나도 난 변하지 않아\r\nAnd then I cry for you\r\n이 밤 지나면 이젠 안녕\r\n영원히\r\n\r\n그대의 아픔도 눈물도 슬픈 상처도\r\n내가 갖겠다던 약속들 잊지 않았기에\r\n울지말아요 이토록 사랑하기에\r\n이젠 안녕 천천히 그리고 영원히\r\n\r\nSo you don’t cry for me\r\n세월 지나도 난 변하지 않아\r\nAnd then I cry for you\r\n이 밤 지나면 이젠 안녕\r\n\r\n영원히 널 사랑해 널 사랑해 \r\n영원히\r\n\r\n널 사랑해 널 사랑해 널 사랑해\r\nSo you don’t cry for me\r\n\t\t\t\t\t</p> \n\t\t\t\t\t\t", writer: nil, composer: nil,  jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/018/358/901/18358901_1442368609068_1_600x600.JPG", song_tjnum: 46180, song_num: 18358941, lowkey: "C4", highkey: "F6"},
                                  {album_id: nil, singer_id: nil, team_id: nil, title: "행복하지 말아요", genre1: "가요", genre2: "락", runtime: "05:59", lyrics: "\n\t\t\t\t\t\t\t<div>행복하지 말아요 - 05:59</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">왜 이리도 \r\n이 세상은 이별이 많은지 \r\n왜 사랑은 힘든건지 \r\n난 궁금했었죠 \r\n난 이제또다시 묻고있죠 \r\n어떻게 견디는지 \r\n이 많은 슬픔 끝나긴 하는지 \r\n\r\n괜찮아요 다 그렇듯 \r\n이러다 말겠죠 \r\n이 가슴도 이 눈물도 \r\n다 가라앉겠죠 \r\n더 안을수록 부서져버릴\r\n우리를 알고 있죠 \r\n보내는일이 사랑이라는걸 \r\n\r\n사랑해 사랑해 말해줄 시간이\r\n아직도 많을줄 알았죠 \r\n언젠가 누군가 그대를 가져갈 \r\n그 사람 벌써부터 \r\n난 부러워지네요 \r\n\r\n행복하지마요 행복하려면 \r\n사랑한 날 잊어야 하잖아 \r\n가시가 박힌듯 숨쉴 때 마다 \r\n눈물이 흘러와 \r\n사는게 사는것이 아니죠 \r\n사랑하지 마요 내가 아니면 \r\n누구와도 영원할 수 없어 \r\n그대를 그 곳에 두고온곳 \r\n그곳만 기억하면 \r\n찾을 수 있죠 잠시 멈춰있는 \r\n사랑인거죠 괜찮아요 \r\n웃어요 \r\n\r\n하루에도 나 몇번씩 \r\n마음이 바뀌죠 \r\n또 버리고 주워담고 \r\n오늘도 그래요 \r\n꼭 좋은사람 만날거라고 \r\n말하는 나였지만 \r\n나의 가슴은 그댈 잡고 있죠 \r\n\r\n사랑해, 사랑해, \r\n나에게 말해 줄 \r\n그대의 목소릴 \r\n이제 들을 수 없겠죠 \r\n조금만 잠시만 \r\n머물다 올것을 \r\n그대의 곁에있는 \r\n그 사람도 아나요 \r\n\r\n행복하지 마요 행복하려면 \r\n사랑한 날 잊어야 하잖아\r\n가시가 박힌듯 숨쉴 때 마다 \r\n눈물이 흘러와 사는게\r\n사는것이 아니죠 \r\n사랑하지 마요 \r\n내가 아니면, 누구와도\r\n영원할 수 없어 \r\n그대를 그 곳에 두고 온곳\r\n그곳만 기억하면 \r\n찾을 수 있죠 \r\n잠시 멈춰있는 사랑인거죠 \r\n괜찮아요 웃어요 \r\n\r\n사랑하지 마요, \r\n내가 아니면\r\n누구와도 영원할 수 없어 \r\n그대를 그곳에 두고 온곳\r\n그곳만 기억하면 \r\n찾을 수 있죠 \r\n잠시 멈춰있는 사랑인거죠\r\n괜찮아요 웃어요 \r\n이 눈물도, 이 아픔도, \r\n괜찮죠</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/029/144/15029144_1404716465049_1_600x600.JPG", song_tjnum: 14260, song_num: 16182421, lowkey: "A4", highkey: "C6"},
