                                        {album_id: nil, singer_id: nil, team_id: nil, title: "Tears", genre1: "가요", genre2: "전체", runtime: "03:57", lyrics: "\n\t\t\t\t\t\t\t<div>Tears - 03:57</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">아무일도 내겐 없는거야 \r\n처음부터 우린 모른거야 \r\n워어우 넌 그렇게 \r\n날 보내줄수는 없겠니 \r\n이제라도 나를 잊어야해 \r\n그런 모습 쉽지는않겠지만\r\n아직 날기다리는 \r\n나 너를 알아 마음이 아파 \r\n\r\n차라리 나를 미워해 \r\n이젠 그만 \r\n내게 미련 보이지마 \r\n두번다시 넌 나를 찾지마 \r\n나로 인해 아파 할테니까\r\n\r\n잔인한 여자라 \r\n나를 욕하지는마 \r\n잠시 너를 위해 \r\n이별을 택한거야 \r\n잊지마 내사랑을 \r\n너는 내안에 있어\r\n길진 않을 꺼야 \r\n슬픔이 가기까지 영원히 \r\n\r\n차라리 나를 미워해 \r\n이젠 그만 \r\n내게 미련 보이지마\r\n두번다시 넌 나를 찾지마 \r\n나로 인해 아파 할테니까\r\n가져가 내게서 \r\n눈먼 너의 사랑을 \r\n모든게 집착인걸 \r\n너도 알고 있잖아 \r\n지독했던 사랑 따윈 \r\n모두 지워 버려줘\r\n길진 않을 꺼야 \r\n마지막 순간까지 사랑해</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/015/023/963/15023963_1406189629874_1_600x600.JPG", song_tjnum: 8797, song_num: 16091433, lowkey: "C5", highkey: "G6"},
