                                            {album_id: nil, singer_id: nil, team_id: nil, title: "Rain", genre1: "가요", genre2: "발라드", runtime: "03:42", lyrics: "\n\t\t\t\t\t\t\t<div>Rain - 03:42</div>\n\t\t\t\t\t\t\t<p id=\"pLyrics\">텅 빈 회색 빛 거린 참 허전해\r\n쓸쓸한 기분에 유리창을 열어\r\n내민 두 손위로 떨어진 빗방울\r\n가득 고이는 그리움\r\n나의 맘에 흘러\r\n \r\n왠지 네가 보고픈 밤 \r\n차오르는 눈물 \r\n떠오르는 나의 맘 속 \r\n \r\n비가 오면 내리는 기억에\r\n번지는 아픔에 \r\n흠뻑 쏟아지는 너를 보다\r\n선명했던 그 시간에 멈춘 채\r\n추억에 젖은 채 \r\n아름다웠던 너를 그려\r\nin the Rain \r\n\r\n길었던 참 눈이 부셨던 계절도\r\n사진첩 속에 얼룩져\r\n색이 바래질까\r\n\r\n점점 깊어가는 이 밤 \r\n잊지 못한 약속 \r\n따뜻했던 품도 안녕 \r\n\r\n비가 오면 내리는 기억에\r\n번지는 아픔에 \r\n흠뻑 쏟아지는 너를 보다\r\n선명했던 그 시간에 멈춘 채\r\n추억에 젖은 채 \r\n아름다웠던 너를 그려\r\nin the Rain\r\n\r\n흑백뿐인 세상 속\r\n한줄기의 빛이 돼준 너\r\n(Rain) 비가 되어 다가와\r\n내 영혼을 환히 밝혀줘 \r\n\r\nDoo-doo-doo-\r\n\r\n우산 아래\r\n나직했던 속삭임 Woo- \r\n가슴 한 켠에 퍼져 네가 들려\r\n오늘 하루 내 안부를 묻듯이\r\n편안한 빗소리\r\n아련히 물든 기억 너란 빗속에\r\nWoo rain, Woo..\r\nDreaming in the Rain</p> \n\t\t\t\t\t\t", writer: nil, composer: nil, jacket: "http://image.genie.co.kr/Y/IMAGE/IMG_ALBUM/080/784/431/80784431_1454420887920_1_600x600.JPG", song_tjnum: 46049, song_num: 85888427, lowkey: "G3#", highkey: "D5#"},
